export const tokenReducer: any = (state, action) => {
  switch (action.type) {
    case "accessTokenExpired":
      return {...state, accessToken:null }
    case "exit":
      return {accessToken:action.payload,refreshToken:action.payload}
    default:
      return state
  }
}
